                            Description = "Development of the first Soviet post-war medium tank started in 1951. In 1961, the T-62 tank with a smoothbore gun was deployed. At the same time a variant, the T-62A, with a rifled gun was also deployed. In March 1962, mass production of the T-62A was discontinued. The T-62 tank was mass-produced from 1961 through 1975, with a total of twenty thousand vehicles manufactured. Later modifications of the vehicle are still in service.",
                            Name = "T-62A",
                            NationID = 2,
                            StrategicRoleId = 4,
                            TypeID = 2,
                            YearOfCreation = 1961,
                            pictureId = 12
                        },
                        new
                        {
                            Id = 2,
                            Description = "A project for a heavy tank with an oscillating turret and automatic loader, developed from 1951. Experimental turrets for 120 mm and 155 mm guns were manufactured by 1957. However, the project was deemed unsuccessful and development was discontinued.",
                            Name = "T57 HEAVY TANK",
                            NationID = 1,
                            StrategicRoleId = 10,
                            TypeID = 3,
                            YearOfCreation = 1957,
                            pictureId = 13
                        },
                        new
                        {
                            Id = 3,
                            Description = "Main battle tank of the Federal Republic of Germany. Development was started in 1956. The first prototypes were built in 1965 at the Krauss-Maffei factory. The Leopard 1 saw service in the armies of more than 10 countries.",
                            Name = "LEOPARD 1",
                            NationID = 3,
                            StrategicRoleId = 5,
                            TypeID = 2,
                            YearOfCreation = 1965,
                            pictureId = 14
                        },
                        new
                        {
                            Id = 4,
                            Description = "A self-propelled gun developed on the basis of the WZ-111 heavy tank in the first half of the 1960s. The development of the WZ-111 was discontinued, and all activity on the vehicle was canceled. No prototypes were built.",
                            Name = "WZ-111G FT",
                            NationID = 4,
                            StrategicRoleId = 12,
                            TypeID = 4,
                            YearOfCreation = 1960,
                            pictureId = 15
                        },
                        new
                        {
                            Id = 5,
                            Description = "An experimental project for an SPG that used some elements of the U.S. M47 chassis. As compared to the Bat.-Châtillon 155 55, the vehicle had a different turret and featured the magazine loading system. Existed only in blueprints.",
                            Name = "BAT.-CHÂTILLON 155 58",
                            NationID = 5,
                            StrategicRoleId = 15,
                            TypeID = 5,
                            YearOfCreation = 1960,
                            pictureId = 16
                        },
                        new
                        {
                            Id = 6,
                            Description = "A light tank project with an oscillating turret for providing anti-tank defense behind infantry positions. No prototypes were built, and it existed only in blueprints.",
                            Name = "MANTICORE ",
                            NationID = 6,
                            StrategicRoleId = 1,
                            TypeID = 1,
                            pictureId = 17
                        },
                        new
                        {
                            Id = 7,
                            Description = "Development of the superheavy tank was started after the Battles of Khalkhyn Gol in 1939. The vehicle was designed as a maneuverable fire unit that was unprecedented in scale—its hull alone weighed 100 tons. Only one prototype was built, without a turret and made of construction steel. Trials were discontinued due to the unreliable engine; at the end of 1944, the prototype was scrapped. The 15 cm howitzer was to be mounted on the tank after its assembly.",
                            Name = "O-I ",
                            NationID = 7,
                            StrategicRoleId = 7,
                            TypeID = 3,
                            YearOfCreation = 1939,
                            pictureId = 18
                        },
                        new
                        {
                            Id = 8,
                            Description = "In the early 1950s, the ČKD company developed a project of a heavy tank for the Czechoslovakian Army based on concepts of the Soviet and German tank-building schools combined with its own ideas. The project was discontinued due to the unification of armament of Warsaw Pact countries. No prototypes were ever built.",
                            Name = "TNH T VZ. 51",
                            NationID = 8,
                            StrategicRoleId = 9,
                            TypeID = 3,
                            YearOfCreation = 1950,
                            pictureId = 19
                        },
                        new
                        {
                            Id = 9,
                            Description = "Developed from 1969 through 1971 as a modernization of the Strv 103. Unlike the previous Strv 103A version, the Strv 103B was equipped with a more powerful gas-turbine engine, laser rangefinder, and infrared devices. The vehicle also accommodated the mounting of amphibious add-on equipment. In 1970, 220 vehicles went into service. At the same time, the vehicles of the previous modification were converted to the Strv 103B, which resulted in a total of 290 vehicles by 1971.",
                            Name = "STRV 103B",
                            NationID = 9,
                            StrategicRoleId = 13,
                            TypeID = 4,
                            YearOfCreation = 1971,
                            pictureId = 20
                        },
                        new
                        {
                            Id = 10,
                            Description = "The vehicle was developed in the 1950s. Using the scaling method, Polish engineers took the elements of a medium tank chassis as the base and adjusted those elements to a different weight category. They were guided by the Soviet T-54, which meant that some of the vehicle's components were similar to the first versions of the Soviet medium tank. As a result, it was an extremely interesting design with a rather low silhouette. However, it existed only in blueprints. Such a heavy vehicle would require too many resources of the Polish industry.",
                            Name = "56TP",
                            NationID = 10,
                            StrategicRoleId = 8,
                            TypeID = 3,
                            YearOfCreation = 1950,
                            pictureId = 21
                        },
                        new
                        {
                            Id = 11,
                            Description = "In 1969, the Italian military delegation visited Germany to discuss the purchase of Leopard tanks. However, not all members of the delegation agreed with the acquisition of foreign vehicles. The Italian military experts and engineers specified the main requirements for the future tank: the slope angle of armor plates, the cast turret and gun mantlet, as well as the powerful engine from Mitsubishi that allowed production of a small, light, maneuverable, but perfectly-armored vehicle. The British and Soviet design plans collected by SIFAR-SID were taken into account. Development of the project was discontinued at the drafting and modelling stage.",
                            Name = "PROGETTO M40 MOD. 65",
                            NationID = 11,
                            StrategicRoleId = 6,
                            TypeID = 2,
                            pictureId = 22
                        },
                        new
